const UserProfile = ({ currentUser }) => {
  return (
    <>
      <Tabs grow>
        <Tabs.Tab icon={<Settings />} label="Profile Settings">
          {<ProfileSettings />}
        </Tabs.Tab>
        <Tabs.Tab label="My Reviews">{<Reviews />}</Tabs.Tab>
        {/* <Tabs.Tab label="Profile Settings"></Tabs.Tab> */}
      </Tabs>
    </>
  );
};

export default UserProfile;
